function addToBasket(productId,quant)
{
	if(quant<=0)
		quant=1;
	if(productId>0)
	{
		jQuery.ajax({
		  	url: "/catalog/functions.php",
		  	data: {
		  		cmd: 'addToBasket',
		  		id: productId,
		  		quant: quant
		  	},
		  	dataType: 'json',
		  	method: 'POST',
		  	success:function(data){
		  		if(data.error==0)
		  		{				
		  			jQuery(".total_prc").text(data.sum);
		  			jQuery(".num_prs").text(data.count);
		  			jQuery(".num_prs_products").text(getWordNumFormat(["товар","товара","товаров"],data.count));
		  			if(jQuery(".basket_button_"+productId).attr("data-inbaskettext"))
		  				jQuery(".basket_button_"+productId).text(jQuery(".basket_button_"+productId).attr( "data-inbaskettext"));
		  			if(jQuery(".basket_button_"+productId).attr("data-inbasketclass"))
		  				jQuery(".basket_button_"+productId).addClass(jQuery(".basket_button_"+productId).attr( "data-inbasketclass"));
		  		}
		  	},
		  	error:function(){
		  	}
		});
	}
}

function updateBasketQuant(basketId,quant)
{
	if(quant>0 && basketId>0)
	{
		jQuery.ajax({
		  	url: "/catalog/functions.php",
		  	data: {
		  		cmd: 'updateBasketQuant',
		  		basketId: basketId,
		  		quant: quant
		  	},
		  	dataType: 'json',
		  	method: 'POST',
		  	success:function(data){
		  		if(data.error==0)
		  		{
		  			jQuery(".total_prc").text(data.sum);
		  			jQuery(".num_prs").text(data.count);
		  			jQuery(".num_prs_products").text(getWordNumFormat(["товар","товара","товаров"],data.count));
		  			jQuery(".basket_iem_sum_"+basketId).text(data.item_sum);					
		  		}
		  	},
		  	error:function(){
		  		
		  	}
		});
	}
}

function getWordNumFormat(titles, number)
{
    cases = [2, 0, 1, 1, 1, 2];
    return titles[ (number%100>4 && number%100<20)? 2 : cases[(number%10<5)?number%10:5] ];
}

jQuery(document).ready(function($){
	
	var header_scroll = $("header");
	$(window).scroll(function() {
		var scroll = $(window).scrollTop();
		if (scroll >= 170) {
			header_scroll.addClass("scroll");
			$("body").addClass("scroll-header");
		} else {
			header_scroll.removeClass("scroll");
			$("body").removeClass("scroll-header");
		}
	});
	
	var modal = (function(){
    var $overlay = $(".overlay"),
    $modal = $('#callback-modal');
    return {
		  open: function(evt) {
			evt.preventDefault();
			$modal.fadeIn();
			$overlay.fadeIn();
		  },
		  hide: function(evt) {
			$modal.fadeOut();
			$overlay.fadeOut();
		  } 
		}
	})();
	$(".js-link-form").on("click" , modal.open);
	$(".overlay").on("click", modal.hide);
	

	buy_btns = $('a[href*="ADD2BASKET"]');
	buy_btns.each(
		function(){
			$(this).attr("rel", $(this).attr("href"));
		}
	);
	buy_btns.attr("href","javascript:void(0);");
	function getBasketHTML(html)
	{
		txt = html.split('<!--start--><div id="bid">');
		txt = txt[2];
		txt = txt.split('</div><!--end-->');
		txt = txt[0];
		return txt;
	}

	$('a[rel*="ADD2BASKET"]').click(                
		function(){
			$.ajax({
			  type: "GET",
			  url: $(this).attr("rel"),
			  dataType: "html",
			  success: function(out){
						$("#bid").html(getBasketHTML(out));
						alert("Товар добавлен в корзину");
			  }

			});
		}
	);


	
})

jQuery(document).ready(function(){

	
	
	jQuery(".catalog_props_title").on("click","a",function(){
		jQuery(".catalog_props_table").hide();
		if(jQuery(this).attr("data-rel"))
		{
			jQuery(".catalog_props_title a").removeClass("b").removeClass("active");
			jQuery(".catalog_props_title a[data-rel="+jQuery(this).attr("data-rel")+"]").addClass("active").addClass("b");
			jQuery("."+jQuery(this).attr("data-rel")).show();
		}
	});
	
	if(jQuery(".product_img_pagi").length>0)
	{
		cat_carousel = jQuery(".product_img_pagi").jcarousel();
		jQuery('.product_img_pagi_navl a')
            .on('jcarouselcontrol:active', function() {
                jQuery(this).removeClass('inactive');
            })
            .on('jcarouselcontrol:inactive', function() {
                jQuery(this).addClass('inactive');
            })
            .jcarouselControl({
                target: '-=1'
            });
        jQuery('.product_img_pagi_navr a')
            .on('jcarouselcontrol:active', function() {
                jQuery(this).removeClass('inactive');
            })
            .on('jcarouselcontrol:inactive', function() {
                jQuery(this).addClass('inactive');
            })
            .jcarouselControl({
                target: '+=1'
            });
        jQuery(".product_img_pagi").on("click","a.product_img_preview",function(){
        	if(jQuery(this).attr("data-bigimg"))
        	{
	        	jQuery(this).closest(".product_img_pagi").find("li").removeClass("active");
	        	jQuery(this).closest("li").addClass("active");
	        	jQuery(this).closest(".product_img_block").find(".product_img_big img").hide();
	        	jQuery(this).closest(".product_img_block").find(".product_img_big img#"+jQuery(this).attr("data-bigimg")).show();
	        }
        });
	}
	
	jQuery("body").on("change",".contr_input",function(){
		if(jQuery(this).attr("data-minval"))
		{
			if(jQuery(this).attr("data-minval")>jQuery(this).val())
				jQuery(this).val(jQuery(this).attr("data-minval"));
		}
		if(jQuery(this).attr("data-maxval"))
		{
			if(jQuery(this).attr("data-maxval")<jQuery(this).val())
				jQuery(this).val(jQuery(this).attr("data-maxval"));
		}
	});
	makeSpinnedInput();
	jQuery("body").on("click",".spinned_input .inp_spinner_up, .spinned_input .inp_spinner_down",function(){
		var step=1;
		var inpC = jQuery(this).closest(".spinned_input").find("input[type=text]");
		if(inpC.attr("data-step"))
			step=1*inpC.attr("data-step");
		if(step==0)
			step=1;
		var inpVal=inpC.val();
		inpVal = inpVal*1 + step*(jQuery(this).hasClass("inp_spinner_up")?1:-1);
		if(inpC.attr("data-minval")>inpVal)
			inpVal=inpC.attr("data-minval");
		if(inpC.attr("data-maxval")<inpVal)
			inpVal=inpC.attr("data-maxval");
		inpC.val(inpVal);
		inpC.trigger('change');
	});
	
	jQuery(".product_info_tabs").on("click",".tab_head a",function(){
		jQuery(this).closest(".product_info_tabs").find(".tab_head").removeClass("opened");
		jQuery(this).closest(".tab_head").addClass("opened");
		jQuery(this).closest(".product_info_tabs").find(".tab_body").hide();
		jQuery(this).closest(".product_info_tabs").find(".tab_body#"+jQuery(this).attr("data-tabid")).show();
		var curLoc=window.location.toString();
		curLoc=curLoc.replace(/tabid=[^&]*&?/g,'').replace(/\?$/g,'').replace(/&$/g,'');
		var stateObj = { foo: "bar" };
		history.pushState(stateObj, document.title, curLoc+(curLoc.indexOf("?")>=0?"&":"?")+"tabid="+jQuery(this).attr("data-tabid"));
	});
	
	jQuery(".fancyPopup").fancybox({
		type: 'iframe',
		padding: [40,65,20,65],
		width: 395,
		height: 290,
		autoSize: false,
		helpers: {
	    	overlay: {
	      		locked: false,
	      		css : {
	                'background' : 'rgba(255, 255, 255, 0.8)'
	            }
	    	}
	  },
	  beforeLoad: function () {
	        var url = $(this.element).attr("data-popuphref");
	        if(url!="")
	        	this.href = url
	    }
	});
	
	jQuery("body").on("mouseenter",".rate_line label",function(){
		for(var qq=0;qq<=5;qq++)
		{
			jQuery(this).closest(".rate_line").removeClass("rate_line"+qq);
		}
		if(jQuery(this).attr("data-rateval"))
			jQuery(this).closest(".rate_line").addClass("rate_line"+jQuery(this).attr("data-rateval"));
	});
	jQuery("body").on("click",".rate_line label",function(){
		for(var qq=0;qq<=5;qq++)
		{
			jQuery(this).closest(".rate_line").removeClass("rate_line"+qq);
		}
		if(jQuery(this).attr("data-rateval"))
			jQuery(this).closest(".rate_line").addClass("rate_line"+jQuery(this).attr("data-rateval")).attr("data-rateval",jQuery(this).attr("data-rateval"));
	});
	jQuery("body").on("mouseleave",".rate_line",function(){
		for(var qq=0;qq<=5;qq++)
		{
			jQuery(this).removeClass("rate_line"+qq);
		}
		if(jQuery(this).attr("data-rateval"))
			jQuery(this).addClass("rate_line"+jQuery(this).attr("data-rateval"));
	});
	
	jQuery(".catalog_item_name .ptr").each(function( index ) {
	  var txt = $( this ).text();
	  if( txt.indexOf('Спецпредложение') != -1 ){
		txt = txt.replace("Спецпредложение", "");
		txt = "<u>Спецпредложение</u><br/>" + txt;
		$( this ).html( txt );
	  }
	});
	
});

function makeSpinnedInput()
{
	jQuery(".spinned_input").each(function(){
		if(jQuery(this).children("input[type=text]").length==1 && jQuery(this).find("a.inp_spinner_up").length==0)
		{
			if(jQuery(this).hasClass("spinned_input_plmin"))
			{
				jQuery(this).prepend("<a href='javascript:void(0)' class='inp_spinner_down'>&ndash;</a>").append("<a href='javascript:void(0)' class='inp_spinner_up'>+</a>");
			}else{
				jQuery(this).append("<div class='inp_spinner'><a href='javascript:void(0)' class='inp_spinner_up'></a><a href='javascript:void(0)' class='inp_spinner_down'></a></div>");
			}
		}
	});
}

