var alienspro_callback = function(lang){
	var clock=function(){
		var canvas, ctx;
		var clockRadius = 80;
		var clockImage;

		function clear() { 
		    ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height);
		}

		function drawScene() { 
		    clear(); 
	
		    var date = new Date();
		    var hours = date.getHours();
		    var minutes = date.getMinutes();
		    var seconds = date.getSeconds();
		    hours = hours > 12 ? hours - 12 : hours;
		    var hour = hours + minutes / 60;
		    var minute = minutes + seconds / 60;
		
		    ctx.save();
		  
		    ctx.drawImage(clockImage, 0, 0, 160, 160);

		    ctx.translate(canvas.width / 2, canvas.height / 2);
		    ctx.beginPath();
  
		    ctx.font = '14px Arial';
		    ctx.fillStyle = '#003768';
		    ctx.textAlign = 'center';
		    ctx.textBaseline = 'middle';
		    for (var n = 1; n <= 12; n++) {
		        var theta = (n - 3) * (Math.PI * 2) / 12;
		        var x = clockRadius * 0.7 * Math.cos(theta);
		        var y = clockRadius * 0.7 * Math.sin(theta);
		        ctx.fillText(n, x, y);
		    }

		    ctx.save();
		    var theta = (hour - 3) * 2 * Math.PI / 12;
		    ctx.rotate(theta);
		    ctx.beginPath();
		    ctx.moveTo(-15, -5);
		    ctx.lineTo(-15, 5);
		    ctx.lineTo(clockRadius * 0.5, 1);
		    ctx.lineTo(clockRadius * 0.5, -1);
		    ctx.fill();
		    ctx.restore();

		    ctx.save();
		    var theta = (minute - 15) * 2 * Math.PI / 60;
		    ctx.rotate(theta);
		    ctx.beginPath();
		    ctx.moveTo(-15, -4);
		    ctx.lineTo(-15, 4);
		    ctx.lineTo(clockRadius * 0.8, 1);
		    ctx.lineTo(clockRadius * 0.8, -1);
		    ctx.fill();
		    ctx.restore();

		    ctx.save();
		    var theta = (seconds - 15) * 2 * Math.PI / 60;
		    ctx.rotate(theta);
		    ctx.beginPath();
		    ctx.moveTo(-15, -3);
		    ctx.lineTo(-15, 3);
		    ctx.lineTo(clockRadius * 0.9, 1);
		    ctx.lineTo(clockRadius * 0.9, -1);
		    ctx.fillStyle = '#003768';
		    ctx.fill();
		    ctx.restore();

		    ctx.restore();
		}
		
		    canvas = document.getElementById('canvas');
		    ctx = canvas.getContext('2d');

		clockImage = new Image();
		clockImage.src = '/bitrix/components/alienspro/callback/templates/.default/images/cface.png';
		drawScene();
		    setInterval(drawScene, 1000); 
		
	};

	var date = new Date();
	var currentTimeZoneOffsetInHours = "GMT+"+-date.getTimezoneOffset()/60;	
	$('.ui-dialog').wrap('<div class="abc" />');

	var dialog = $('#callback-block').dialog({
		autoOpen: false,
	    height: 'auto',
	    width: 350,
	    modal: true,
	    title:lang.title,
	    draggable: false,
	    resizable: false,
	    close: function(event, ui){
		        $(".alienspro-callback").filter(function(){
		            if ($(this).text() == "")
		            {
		                return true;
		            }
		            return false;
		        }).remove();

		     	$.each($('#callback-block input'),function(key,value){
		    			$(value).removeClass('req');
		    	});
		}, 
	    create: function(event, ui){
        	$('.ui-dialog').wrap('<div class="alienspro-callback" />');
		},
		open: function(event, ui){
		    $('.ui-widget-overlay').wrap('<div class="alienspro-callback" />');
		    clock();
		},
	});
	form = dialog.find( "form" ).on( "submit", function( event ) {
		
	    event.preventDefault();
	    $('.send-button').attr("disabled", true);
	    
	    $.ajax({
	    	method:'post',
	    	data:{
	    		user_name:$('#user_name').val(),
	    		user_phone:$('#user_phone').val(),
	    		user_email:$('#user_email').val(),
	    		user_theme:$('#user_theme').val(),
	    		user_time:$('#time-after').text()+'-'+$('#time-before').text()+' '+currentTimeZoneOffsetInHours,
	    		PARAMS_HASH:$('#PARAMS_HASH').val(),
	    		captcha_sid:$('#captcha_sid').val(),
	    		captcha_word:$('#captcha_word').val(),
	    		sessid:$('#sessid').val(),
	    		ajax:'y',
	    	},
	    	success:function(msg){
	    		$('.send-button').attr("disabled", false);

	    		var err = (JSON.parse(msg));
	    		
	    		if(err.success=='no'){
		    		$.each($('#callback-block input'),function(key,value){
		    			$(value).removeClass('req');
		    		});
		    		$.each(err,function(key,value){		
		    			if(value==true){	
		    				$('#'+key).addClass('req');
		    			}
		    		});
					captchaload();
		    	}else{
		    		var msgNodes='';   
		    		msgNodes += '<div id="dialog-message">';
					msgNodes +=		'<p class="success-msg">'+err.success+'</p>';
					msgNodes +=	'</div>';
		    		dialog.dialog("close");
		    		    $( msgNodes).dialog({
					      modal: true,
					      title:lang.title,
					      draggable: false,
	   					  resizable: false,
					      close: function(event, ui){
						        $(".alienspro-callback").filter(function(){
						            if ($(this).text() == "")
						            {
						                return true;
						            }
						            return false;
						        }).remove();
								$.each($('#callback-block input'),function(key,value){
			    					$(value).removeClass('req');
			    				});
							},
 
						    create: function(event, ui){
					        	$('.ui-dialog').wrap('<div class="alienspro-callback" />');
							},
							open: function(event, ui){
							    $('.ui-widget-overlay').wrap('<div class="alienspro-callback" />');
							},
						      buttons: {
						        Ok: function() {
						          $( this ).dialog( "close" );
						        }
						      }
					    });
		    	}
	    	}
	    })
	});

	$('#open-btn').click(function(){
		dialog.dialog( "open" );
	});

	$('#reload-captcha').click(function(){
		captchaload()
	});
	
	function captchaload(){
				$.ajax({
			method:'POST',
			data:{reload_captcha:'y'},
			success:function(msg){
				$('#captcha_sid').val(msg);
				$('#captcha_img').attr('src','/bitrix/tools/captcha.php?captcha_sid='+msg)
			}
		});
	}
};






